const state = {}

const mutations = {}

const actions = {
  async categoryList({ commit }) {
    let result = await reqCatagoryList();
    if (result.code == 200) {

      commit('CATEGORYLIST')
    }
  }
}

const getters = {}


export default {
  state, mutations, actions, getters
}
